import { BrowserRouter, Route, Switch } from 'react-router-dom'
import Home from './Home';
im


function App() {
  return (
    <CurrentUserProvider>
     <BrowserRouter>
      <Navigation />
      <Switch>
        <Route exact path="/" element={<Home />} />
      </Switch>
     </BrowserRouter>
    </CurrentUserProvider>
  );
}

export default App;
